import React from "react";
import "./blog.css";

export default function Blog() {
    return (
        <div className="container">
            <h2>블로그 페이지</h2>
            <section className="posts">
                <article className="post"></article>
            </section>
            <aside className="sidebar"></aside>
        </div>
    );
}
